import styled from "styled-components";

const Cricle = styled.div`
width: 100px;
height: 100px;
border-radius:50%;
border: 1px solid rgb(197, 197, 197);
background-color: white;
box-shadow:0px 0px 4px grey;
`

const Bubble = ({target,src}) => {
    return (
        <div>
            <Cricle/>
            <h1></h1>
            <h2></h2>
        </div>
    );
}

export default Bubble;
